background_data = ""


death_data = ""

from PIL import Image
import io

def get_ceasar_image(pygame):
    data = ceasar_data.encode("ascii")
    decoded_data = b64.b64decode(data)
    
    # Load the image data into a Pygame Surface
    image_io = io.BytesIO(decoded_data)
    image = Image.open(image_io)  # Use PIL to read the image
    image_surface = pygame.image.fromstring(image.tobytes(), image.size, image.mode)

    return image_surface
    
