def get_death_noise(pygame): 
    data = death_data.encode("ascii")
    decoded_data = b64.b64decode(data)
    
    # Load the image data into a Pygame Surface
    sound_io = io.BytesIO(decoded_data)

    # Load the sound from the in-memory file
    sound = pygame.mixer.Sound(file=sound_io)



    return sound